{ 
    string num = n; 
    ll dec_value = 0; 

    // Initializing base value to 1, i.e 2^0 
    ll base = 1; 

    ll len = num.length(); 
    for (ll i = len - 1; i >= 0; i--) { 
        if (num[i] == '1') 
            dec_value += base; 
        base = base * 2; 
    } 

    return dec_value; 
} 

