	}
	if(dp[N][0]>=dp[N][1]){
		for(int i=1;i<=N;i++) printf("%c",s[i]); printf("\n");
		return 0;
	}
	int now=dp[N][1]-dp[N][0];
	for(int i=N;i>=1;i--)
		if(s[i]=='0') ans[i]='0';
		else{
			if(dp[i][1]-dp[i][0]==now&&now) --now,ans[i]='1';
			else ans[i]='0'; 
		}
	for(int i=1;i<=N;i++) printf("%c",ans[i]); printf("\n");
	return 0;
}
