public final class LostAnArrayCF {
    public static void main(String[] args) throws IOException {
        BufferedReader br=new BufferedReader(new InputStreamReader(System.in));
        String s[]=br.readLine().split(" ");
        int n=Integer.parseInt(s[0]);
        int l=Integer.parseInt(s[1]);
        int r=Integer.parseInt(s[2]);
        long low=(n-(l-1))+helper(l-1);
        long high=helper1(r,n);
        System.out.println(low+" "+high);
    }

    private static long helper1(int count,int n) {
        int left=n-count;
        long ans=0,tp=1;
        while (count>0){
            ans+=tp;
            tp*=2;
            count--;
        }
        tp/=2;
        System.out.println(ans);
        while (left>0){
            ans+=tp;
            left--;
        }
        return ans;
    }

    private static long helper(long count) {
        if(count==0) return 0;
        long ans=0,tp=1;
        while (count>0){
            tp*=2;
            ans+=tp;
            count--;
        }
        return ans;
    }
}
