int fac[N],iv[N],n,m,ans,d;
inline int pow(int a,int b){int ret=1;for(;b;b>>=1,a=(LL)a*a%md)if(b&1)ret=(LL)ret*a%md;return ret;}
inline int C(int n,int m){return(LL)fac[n]*iv[m]%md*iv[n-m]%md;}
inline int f(int x){return(m+x>=n)?C(n+m,n-x):d;}
int main(){
	scanf("%d%d",&n,&m);
	for(int i=*fac=1;i<=n+m;++i)fac[i]=(LL)fac[i-1]*i%md;
	iv[n+m]=pow(fac[n+m],md-2);
	for(int i=n+m-1;~i;--i)iv[i]=(i+1LL)*iv[i+1]%md;
	d=C(n+m,n);
	ans=(LL)f(n)*n%md;
	for(int i=n-1;i>=0;--i)ans=(ans+(LL)(f(i)-f(i+1)+md)*i)%md;
	printf("%d\n",ans);
	return 0;
}']

["#include<bits/stdc++.h>
