int main()
{
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);

    int n;
    char it;
    cin>>n;
    vector< vector<int> >dist(n, vector<int>(n));
    for(int i=0;i<n;i++)
    {
        for(int j=0;j<n;j++)
        {
            cin>>it;
            if(it == '1')
                dist[i][j] = 1;
            else if(i == j)
                dist[i][j] = 0;
            else
                dist[i][j] = 1e9;
        }
    }

    int m;
    cin>>m;
    vector<int>p(m),v;
    for(int i=0;i<m;i++)
    {
        cin>>p[i];
        p[i]--;
    }

    for(int k=0;k<n;k++)
    {
        for(int i=0;i<n;i++)
        {
            for(int j=0;j<n;j++)
                dist[i][j] = min(dist[i][j], dist[i][k] + dist[k][j]);
        }
    }

    int start = 0;
    v.emplace_back(start);
    for(int i=1;i<m-1;i++)
    {
        if(dist[ p[start] ][ p[i+1] ] != i+1-start)
        {
            start = i;
            v.emplace_back(i);
        }
    }
    v.emplace_back(m-1);
    cout<<v.size()<<'\n';
    for(auto x:v)
        cout<<++p[x]<<' ';

    return 0;
}"]

