['#include <bits/stdc++.h>

using namespace std;

const int maxn = 107;

vector <int> adj[maxn];
int n, D[maxn][maxn], dp[maxn], tr[maxn], path[maxn];

void trace(int x)
{
    if (!x) return;
    trace(tr[x]);
    cout << path[x] << ' ';
}

void Dijkstra(int s)
{
    for (int i = 1; i <= n; ++i) D[s][i] = maxn;
    D[s][s] = 0;
    set <pair <int, int> > S;
    S.insert({0, s});

    while (S.size())
    {
        pair <int, int> p = *S.begin();
        S.erase(S.begin());
        int u = p.second;
        if (p.first > D[s][u]) continue;
        for (int v: adj[u])
            if (D[s][v] > D[s][u] + 1)
            {
                D[s][v] = D[s][u] + 1;
                S.insert({D[s][v], v});
            }
    }
}

int main()
{
//    freopen("TEST.INP", "r", stdin);
//    freopen("TEST.OUT", "w", stdout);
    ios_base::sync_with_stdio(0);
    cin.tie(0), cout.tie(0);
    cin >> n;
    for (int i = 1; i <= n; ++i)
        for (int j = 1; j <= n; ++j)
        {
            char x;
            cin >> x;
            if (x == '1') adj[i].push_back(j);
        }
    for (int i = 1; i <= n; ++i) Dijkstra(i);

    int m;
    cin >> m;
    for (int i = 1; i <= m; ++i) cin >> path[i];
    dp[1] = 1;
    for (int i = 2; i <= m; ++i)
    {
        tr[i] = dp[i] = maxn;
        for (int j = max(i - n, 1); j < i; ++j)
            if (D[path[j]][path[i]] == i - j && dp[i] > dp[j] + 1)
                dp[i] = dp[j] + 1, tr[i] = j;
    }

    cout << dp[m] << '\n';
    trace(m);
    return 0;
}
']

