["<?php

function kirksFunction($binaryString) {
    $zeros = 0;
    $ones = 0;
    for ($i = strlen($binaryString)-1; $i >= 0; $i--) {
        if ($binaryString[$i] == '0') {
            $zeros++;
        }
        else {
            $ones++;
            if ($ones > $zeros) {
                $binaryString[$i] = '0';
                $ones--;
            }
        }
    }
    return $binaryString;
}

function main() {
    $binaryString = readline();
    echo kirksFunction($binaryString);
}

main();
?>"]

