using namespace std;
llt binaryToDecimal(llt n) 
{ 
    llt num = n; 
    llt dec_value = 0; 
  
    // Initializing base value to 1, i.e 2^0 
    llt base = 1; 
  
    llt temp = num; 
    while (temp) { 
        llt last_digit = temp % 10; 
        temp = temp / 10; 
  
        dec_value += last_digit * base; 
  
        base = base * 2; 
    } 
  
    return dec_value; 
} 
int main()
{
    llt s;
    cin>>s;
    
     s=binaryToDecimal(s);
    
    llt count=0;
    while(pow(4,count) < s)
    {
        count++;
    }
    cout<<count<<endl;
    
    
}']

