['#include <bits/stdc++.h>
using namespace std;
#include <ext/pb_ds/assoc_container.hpp>
#include <ext/pb_ds/tree_policy.hpp>
using namespace __gnu_pbds;
#define M 1000000007
#define ll long long
#define REP(i,a,b) for(ll i=a;i<b;i++)
#define REPI(i,a,b) for(ll i=b-1;i>=a;i--)
#define F first
#define S second
#define PB push_back
#define MP make_pair
#define MT make_tuple
#define G(a,b) get<a>(b)
#define VI vector<int>
#define VLL vector<long long>
 
#define o_set tree<int, null_type,less<int>, rb_tree_tag,tree_order_statistics_node_update>
#define o_setll tree<ll, null_type,less<ll>, rb_tree_tag,tree_order_statistics_node_update>
//member functions :
//1. order_of_key(k) : number of elements strictly lesser than k
//2. find_by_order(k) : k-th element in the set
 
ll modI(ll a, ll m);
ll gcd(ll a, ll b);
ll powM(ll x, unsigned ll y, unsigned ll m);
void pairsort(int a[], int b[], int n);
void pairsortll(ll a[],ll b[],ll n);
ll logint(ll x,ll y);
 
 
ll gcd(ll x,ll y)
{
    if(x==0) return y;
    return gcd(y%x,x);
}
 
ll powM(ll x,ll y,ll m)
{
    if(y==0) return 1;
    ll p=powM(x,y/2,m)%m;
    p=(p*p)%m;
    return (y%2==0)?p:(x*p)%m;
}
 
ll modI(ll a, ll m)
{
    ll m0=m,y=0,x=1;
    if(m==1) return 0;
    while(a>1)
    {
        ll q=a/m;
        ll t=m;
        m=a%m;
        a=t;
        t=y;
        y=x-q*y;
        x=t;
    }
    if(x<0) x+=m0;
    return x;
}
 
void pairsort(int a[],int b[],int n)
{
    pair<int,int> v[n];
    REP(i,0,n)
    {
        v[i].F=a[i];
        v[i].S=b[i];
    }
    sort(v,v+n);
    REP(i,0,n)
    {
        a[i]=v[i].F;
        b[i]=v[i].S;
    }
}
 
void pairsortll(ll a[],ll b[],ll n)
{
    pair<ll,ll> v[n];
    REP(i,0,n)
    {
        v[i].F=a[i];
        v[i].S=b[i];
    }
    sort(v,v+n);
    REP(i,0,n)
    {
        a[i]=v[i].F;
        b[i]=v[i].S;
    }
}
 
ll logint(ll x,ll y)
{
    ll ans=0;
    ll a=1;
    for(ll i=0;i<=x;i++)
    {
        if(x<a)
        {
            return ans;
        }
        ans++;
        a*=y;
    }
    return -1;
}
 
int main()
{
    ios::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);
 
    
    freopen("input.txt", "r", stdin);
    freopen("output.txt", "w", stdout);
    
 
    ll q=1;
    //cin>>q;
    while(q--)
    {
        string s;
        cin>>s;
        string t=s;
        ll n=s.size();
        stack<ll> st;
        REP(i,0,n)
        {
            if(s[i]=='1') st.push(i);
            else 
            {
                if (!st.empty()) st.pop();
            }
        }
        while(!st.empty()) 
        {
            ll x=st.top();
            t[x]='0';
            st.pop();
        }
        cout<<t<<endl;

    }
 
    return 0;
}']

["#include<bits/stdc++.h>
using namespace std;
typedef long long ll;
typedef pair<char,ll> pll;
typedef pair<int,int> pii;
const ll N = 2e2;
const ll M = 2e6;
const ll mod = 100000;

int G[N][N];
int p[M];
char c;
int n,m;
vector<int> ans;

int floyd() {
    for(int k=1;k<=n;k++) {
        for(int i=1;i<=n;i++) {
            for(int j=1;j<=n;j++) {
                G[i][j] = min(G[i][j], G[i][k]+G[k][j]);
            }
        }
    }
}

int main() {
    cin>>n;
    for(int i=1;i<=n;i++) {
        for(int j=1;j<=n;j++) {
            cin>>c;
            if(c=='1') G[i][j] = 1;
            else G[i][j] = 0x3f3f3f3f;
            if(i==j) G[i][j] = 0;
        }
    }
    floyd();
    cin>>m;
    for(int i=1;i<=m;i++) cin>>p[i];
    ans.push_back(p[1]);
    int dis = 0;
    for(int i=2;i<=m;i++) {
        dis += G[p[i-1]][p[i]];
        if(dis > G[ans.back()][p[i]]){
            ans.push_back(p[i-1]);
            dis = G[ans.back()][p[i]];
        }
    }
    ans.push_back(p[m]);
    cout<<ans.size()<<endl;
    for(int x:ans) cout<<x<<' ';
    cout<<endl;
}

