    ios_base::sync_with_stdio(false);
    cin.tie(NULL);
    cout.tie(NULL);

    string s;
    cin >> s;
    int n = s.size();
    int suf[n + 1], so = 0;
    suf[n] = 0;
    suf[n - 1] = 1;
    so += (s.back() == '1');

    for (int i = n - 2; i >= 0; i--) {
        if (s[i] == '0') {
            suf[i] = suf[i + 1] + 1;
        }
        else {
            ++so;
            suf[i] = max(suf[i + 1], so);
        }
    }

    int p = 1, z;
    int len = suf[0];
    if (s[0] == '1') {
        if (suf[0] == suf[1] + 1) {
            s.front() = '0';
            z = 1;
        }
        else {
            z = 0;
        }
    }
    else {
        z = 1;
    }

    for (int i = 1; i < n; i++) {
        if (s[i] == '1') {
            --so;
            if (max(p + so, z + 1 + suf[i + 1]) == len) {
                s[i] = '0';
                ++z;
                p = max(p, z);
            }
        }

        else {
            ++z;
            p = max(p, z);
        }
    }

    cout << s;
}']

