    {
        F[i] = (F[i - 1] * i) % MOD;
        I[i] = pw(F[i], MOD - 2, MOD);
    }
    ll ans = 0;
    for(int i = 1; i <= n; i++)
    {
        if(i >= n - m)
        {
            ans = (ans + E(n - i, n + m)) % MOD;
        }
        else
        {
            ans = (ans + E(n, n + m)) % MOD;
        }
    }
