void findMin(int n, int l, int r){
	set<int> data;
	data.insert(1);
	int sum = 1;
	for(int i = 1; i < n; i++){
		if(data.size() == l){
			sum += 1;
		}else{
			int num = *max_element(data.begin(), data.end()) * 2;
			data.insert(num);
			sum += num;
		}
	}
	cout << sum << " ";
}

void findMax(int n, int l, int r){
	set<int> data;
	data.insert(1);
	int sum = 1;
	for(int i = 1; i < n; i++){
		if(data.size() != r){
			int num = *max_element(data.begin(), data.end()) * 2;
			data.insert(num);
			sum += num;
		}else{
			sum += *max_element(data.begin(), data.end());
		}
	}
	cout << sum << endl;
}

int main(){
	int n, l, r;
	cin >> n >> l >> r;
	findMin(n, l, r);
	findMax(n, l, r);
