['#include <bits/stdc++.h>

using namespace std;

int main() {
    string ss;
    cin >> ss;
    vector<int> counts;
    int cur = 1;
    int sign = ss[0] == '0' ? -1 : 1;
    for (int i = 1; i < ss.size(); i++) {
        if (ss[i] != ss[i -1]) {
            counts.push_back(cur * sign);
            cur = 1;
            sign = -sign;
        } else cur++;
    }
    counts.push_back(cur * sign);
    vector<int> mini(counts.size());
    
    int pos = counts.size() - 1;
    if (counts[pos] < 0) pos--;
    else counts.push_back(0);
    
    mini[pos] = counts[pos] + counts[pos + 1];
    pos -= 2;

    while(pos > 0) {
        int val = counts[pos] + counts[pos + 1];
        int nmini = min(val, mini[pos + 2] + val);
        mini[pos] = nmini;
        pos -= 2;
    }
    
    string out = "";

    for (int i = 0; i < counts.size(); i++) {
        if (counts[i] <= 0) {
            for(int j = -counts[i]; j > 0; j--) out.push_back('0');
        } else {
            if (mini[i] > 0) {
                for(int j = counts[i] + counts[i + 1]; j > 0; j--) out.push_back('0');
                for(int j = -counts[i + 1]; j > 0; j--) out.push_back('1');
            } else {
                for(int j = counts[i]; j > 0; j--) out.push_back('1');                
            }
        }
    }
    
    cout << out << endl;
    return 0;
}
