['#include<bits/stdc++.h>
using namespace std;

#define ll long long

void solve(int n, int l, int r){
	ll minSum=n-l, maxSum=0;
	ll curr = 1;
	for(int i=0; i<l; i++){
		minSum += curr;
		curr *= 2;
	}
	curr = pow(2, r-1);
	maxSum = curr*(n-r+1);
	for(int i=0; i<r-1; i++){
		curr /= 2;
		maxSum += curr;
	}
	cout << minSum << " " << maxSum << "\n";
}

int main(){
	int n, l, r;
	cin >> n >> l >> r;
	solve(n, l, r);
	return 0;
}']

