const int INF = 1e9;

int n;
set<int> g[maxn];
int dp[maxn][maxn];
int m;
int path[maxm];
vector<int> ans;

int main() {

  ios_base::sync_with_stdio(false);
  cin.tie(0); cout.tie(0);

  cin >> n;

  for (int i = 1; i <= n; i++) {
    string s; cin >> s;
    for (int j = 1; j <= n; j++) {
      if (s[j-1]-'0') g[i].insert(j);
    }
  }

  cin >> m;
  for (int i = 1; i <= m; i++) cin >> path[i];

  for (int i = 1; i <= n; i++) {
    for (int j = 1; j <= n; j++) {
      if (g[i].count(j)) dp[i][j] = 1;
      else dp[i][j] = INF;
    }
    dp[i][i] = 0;
  }

  for (int k = 1; k <= n; k++) {
    for (int i = 1; i <= n; i++) {
      for (int j = 1; j <= n; j++) {
        dp[i][j] = min(dp[i][j], dp[i][k]+dp[k][j]);
      }
    }
  }

  // for (int i = 1; i <= n; i++) {
  //   for (int j = 1; j <= n; j++) {
  //     cout << "(" << i << ", " << j << ") = " << dp[i][j] << "\n";
  //   }
  //   cout << "\n";
  // }

  ans.push_back(path[1]);
  int prv = path[1];

  for (int i = 2; i+1 <= m; i++) {
    int cur = path[i];
    int nxt = path[i+1];
    int woMe = dp[prv][nxt];
    int withMe = dp[prv][cur] + dp[cur][nxt];
    if (withMe > woMe) {
      ans.push_back(cur);
      prv = cur;
    }
  }

  ans.push_back(path[m]);

  cout << ans.size() << "\n";
  for (auto x: ans) cout << x << " ";
  cout << "\n";


  return 0;
}
