['#include <bits/stdc++.h>
using namespace std;

int main()
{
    int n,m;
    cin>>n;
    vector<string> g(n);
    for(int i=0;i<n;i++){
        cin>>g[i];
    }

    cin>>m;
    vector<int> p(m);
    for(int i=0;i<m;i++){
        cin>>p[i];
    }

    int G[n][n];
    for(int i=0;i<n;i++){
        for(int j=0;j<n;j++){
            G[i][j] = g[i][j]-'0';
            if(!G[i][j])
                G[i][j]=200;
            G[i][i]=0;
        }
    }
    for(int k=0;k<n;k++){
        for(int i=0;i<n;i++){
            for(int j=0;j<n;j++){
                if(G[i][k]+G[k][j]<G[i][j])
                    G[i][j]=G[i][k]+G[k][j];
            }
        }
    }

//    cout<<"\n";
//    for(int i=0;i<n;i++){
//        for(int j=0;j<n;j++){
//            cout<<G[i][j]<<" ";
//        }
//        cout<<endl;
//    }
//    cout<<endl;

    vector<int> ans;
    ans.push_back(p[0]);
    int lastpos=0;
    for(int i=2;i<m;i++){
       if(i-lastpos>G[ans[ans.size()-1]-1][p[i]-1]){
           // cout<<p[i-1]<<" ";
            ans.push_back(p[i-1]);
            lastpos=i-1;
       }
    }
    ans.push_back(p[m-1]);
//cout<<endl;
    cout<<ans.size()<<"\n";
    for(int i=0;i<ans.size();i++){
        cout<<ans[i]<<" ";
    }
    return 0;
}
