['#include <iostream>

using namespace std;

int countMin(int &l,int n) {
	int count = 0,amount=1;

	while (l > 0) {
		count += amount;
		amount *= 2;
	
		l--;
		n--;
	}
	while (n > 0) {
		count++;
		n--;
	}

	return count;
}

int countMax(int& r, int n) {
	int count = 0,help=0,amount=1;
	while (help < r) {
		help++;
		count += amount;
		amount *= 2;
		n--;
	}
	amount /= 2;
	while (n > 0) {
		count += amount;
		n--;
	}
	return count;
}


int main() {
	int l, r, n;

	cin >> n >> l >> r;
	cout << countMin(l, n) << " " << countMax(r, n);
}	']

['#include <cstdio>
