["#include <bits/stdc++.h>

using namespace std;
#define ll long long
#define pb push_back
#define ios ios_base::sync_with_stdio(false);cin.tie();cout.tie();
const ll mod = 998244353;
const int N = 1e5;
int s[N];
int t[N];
int dps[4 * N][2][2];
int dpt[4 * N][2][2];

void build(int v, int l, int r) {
    if (l == r) {
        dps[v][0][0] = 0;
        dps[v][0][1] = 0;
        dps[v][1][0] = 0;
        dps[v][1][1] = 0;
        dpt[v][0][0] = 0;
        dpt[v][0][1] = 0;
        dpt[v][1][0] = 0;
        dpt[v][1][1] = 0;
    } else {
        int m = (l + r) / 2;
        build(v * 2, l, m);
        build(v * 2 + 1, m + 1, r);
        for (int bg = 0; bg < 2; ++bg) {
            for (int ed = bg; ed < 2; ++ed) {
                dps[v][bg][ed] = 0;
                dpt[v][bg][ed] = 0;
                for (int e1 = bg; e1 <= ed; ++e1) {
                    for (int b2 = e1; b2 <= ed; ++b2) {
                        dps[v][bg][ed] = max(dps[v][bg][ed], dps[v * 2][bg][e1] + dps[v * 2 + 1][b2][ed]);
                        dpt[v][bg][ed] = max(dpt[v][bg][ed], dpt[v * 2][bg][e1] + dpt[v * 2 + 1][b2][ed]);
                    }
                }
            }
        }
    }
}

void upds(int v, int l, int r, int ps, int val) {
    if (l == r) {
        dps[v][0][0] = 0;
        dps[v][0][1] = 0;
        dps[v][1][0] = 0;
        dps[v][1][1] = 0;
        if (val)dps[v][1][1] = 1;
        else dps[v][0][0] = 1;
    } else {
        int m = (l + r) / 2;
        if (ps <= m)upds(v * 2, l, m, ps, val);
        else upds(v * 2 + 1, m + 1, r, ps, val);
        for (int bg = 0; bg < 2; ++bg) {
            for (int ed = bg; ed < 2; ++ed) {
                dps[v][bg][ed] = 0;
                dpt[v][bg][ed] = 0;
                for (int e1 = bg; e1 <= ed; ++e1) {
                    for (int b2 = e1; b2 <= ed; ++b2) {
                        dps[v][bg][ed] = max(dps[v][bg][ed], dps[v * 2][bg][e1] + dps[v * 2 + 1][b2][ed]);
                        dpt[v][bg][ed] = max(dpt[v][bg][ed], dpt[v * 2][bg][e1] + dpt[v * 2 + 1][b2][ed]);
                    }
                }
            }
        }
    }
}

void updt(int v, int l, int r, int ps, int val) {
    if (l == r) {
        dpt[v][0][0] = 0;
        dpt[v][0][1] = 0;
        dpt[v][1][0] = 0;
        dpt[v][1][1] = 0;
        if (val)dpt[v][1][1] = 1;
        else dpt[v][0][0] = 1;
    } else {
        int m = (l + r) / 2;
        if (ps <= m)updt(v * 2, l, m, ps, val);
        else updt(v * 2 + 1, m + 1, r, ps, val);
        for (int bg = 0; bg < 2; ++bg) {
            for (int ed = bg; ed < 2; ++ed) {
                dps[v][bg][ed] = 0;
                dpt[v][bg][ed] = 0;
                for (int e1 = bg; e1 <= ed; ++e1) {
                    for (int b2 = e1; b2 <= ed; ++b2) {
                        dps[v][bg][ed] = max(dps[v][bg][ed], dps[v * 2][bg][e1] + dps[v * 2 + 1][b2][ed]);
                        dpt[v][bg][ed] = max(dpt[v][bg][ed], dpt[v * 2][bg][e1] + dpt[v * 2 + 1][b2][ed]);
                    }
                }
            }
        }
    }
}

int gets() {
    int mx = 0;
    for (int i = 0; i < 2; ++i) {
        for (int j = 0; j < 2; ++j) {
            mx = max(mx, dps[1][i][j]);
        }
    }
    return mx;
}

int gett() {
    int mx = 0;
    for (int i = 0; i < 2; ++i) {
        for (int j = 0; j < 2; ++j) {
            mx = max(mx, dpt[1][i][j]);
        }
    }
    return mx;
}

bool ok() {
    return gett() == gets();
}

signed main() {
    ios;
    string S;
    cin >> S;
    int n = S.length();
    for (int i = 0; i < n; ++i) {
        s[i] = S[i] - '0';
    }
    build(1, 0, n - 1);
    for (int j = n - 1; j >= 0; --j) {
        upds(1, 0, n - 1, j, s[j]);
        updt(1, 0, n - 1, j, 0);
        t[j] = 0;
        if (!ok()){
            updt(1,0,n-1,j,1);
            t[j] = 1;
        }
    }
    for (int k = 0; k < n; ++k) {
        cout << t[k];
    }
}"]

