    Scanner scan=new Scanner(System.in);
    int n=scan.nextInt();
    int l=scan.nextInt();
    int r=scan.nextInt();
    System.out.println(mina(n,l,r)+" " +maxa(n,l,r));

  }
  public static int mina(int n,int l,int r)
  {
    int min=n-l+1;n=n-min;int temp=2;
    for(int y=0;y<n;y++)
    {min+=temp;temp*=2;}
    return min;
  }
  public static int maxa(int n,int l,int r)
  {
    int temp=n-r;int cu=1;int max=0;
    for(int i=0;i<r;i++)
    {
      max+=cu;cu*=2;
    }
    cu/=2;
    max+=temp*cu;
    return max;


  }
}']

