['#include<bits/stdc++.h>
#define lson(p) p<<1
#define rson(p) p<<1|1
using namespace std;
const int maxn=1e5;
const int INF=0x3f3f3f3f;
char s[maxn+5];
int ans[maxn+5];
int sum[maxn+5];
struct node
{
    int delta;
    int mn;
}b[4*maxn+5];
void pushup(int p)
{
    b[p].mn=min(b[lson(p)].mn,b[rson(p)].mn);
}
void build(int p,int l,int r)
{
    if (l==r) {
        b[p].mn=sum[l];
        return ;
    }
    int mid=(l+r)>>1;
    build(lson(p),l,mid);
    build(rson(p),mid+1,r);
    pushup(p);
}
void pushdown(int p)
{
    if (b[p].delta) {
        b[lson(p)].mn+=b[p].delta; b[lson(p)].delta+=b[p].delta;
        b[rson(p)].mn+=b[p].delta; b[rson(p)].delta+=b[p].delta;
        b[p].delta=0;
    }
}
void change(int p,int l,int r,int L,int R,int v)
{
    if (L<=l&&r<=R) {
        b[p].mn+=v; b[p].delta+=v;
        return ;
    }
    int mid=(l+r)>>1;
    pushdown(p);
    if (L<=mid) change(lson(p),l,mid,L,R,v);
    if (R>mid) change(rson(p),mid+1,r,L,R,v);
    pushup(p);
}
int getMn(int p,int l,int r,int L,int R)
{
    if (L<=l&&r<=R) return b[p].mn;
    int mid=(l+r)>>1;
    pushdown(p);
    int ans=INF;
    if (L<=mid) ans=min(ans,getMn(lson(p),l,mid,L,R));
    if (R>mid) ans=min(ans,getMn(rson(p),mid+1,r,L,R));
    return ans;
}
int main()
{
    scanf("%s",s+1);
    int n=strlen(s+1);
    for (int i=1;i<=n;i++)
        if (s[i]=='0') sum[i]=sum[i-1]-1;
        else sum[i]=sum[i-1]+1;
    build(1,1,n);
    for (int i=1;i<=n;i++) {
        if (s[i]=='0') {
            change(1,1,n,i,n,1);
            ans[i]=0;
        }
        else {
            if (getMn(1,1,n,i,n)>0) ans[i]=0;
            else ans[i]=1;
            change(1,1,n,i,n,-1);
        }
    }
    for (int i=1;i<=n;i++) printf("%d",ans[i]);
    return 0;
}
']

