['/*Mislove的数组a1，a2，an 是n个正整数的a，
但是他已经丢失了它。他只记得有关以 下事实：
数组中不同数字的数量不小于l并且不大于r；
对于每个数组的元素ai，ai = 1或ai是偶数，并且数组中有数字ai/2。
例如，如果n = 5，l = 2，r = 3，则数组可以是[1,2,2,4,4]或[1,1,1,1,2]；
但是不能为[1,2,2,4,8]， 因为此 数组包含4个不同的数字；
它不可能是[1,2,2,3,3]，因为3是奇数且不等于1；并且它不可能是[1,1,2,2,16]，
因为数组中有数字16，但是没有数字162 = 8。
 根据这些事实，他要求您计算数组中所有元素的最小和最大和。
输入值
唯一的输入行包含三个整数n，l和r（1≤n≤1000，1≤l≤r≤min（n，20））
—数组的大小，数组 中不同元素的最小数量和最大数量。
输出量
输出两个数字-数组中所有元素的最小和最大和。*/ 
#include <bits/stdc++.h>
