// C++ program to convert binary to decimal
// when input is represented as binary string.
// Function to convert binary to decimal
long double binaryToDecimal(string n) {
    string num = n;
    long double dec_value = 0.0;

    // Initializing base value to 1, i.e 2^0
    long double base = 1.0;

    int len = num.length();
    for (int i = len - 1; i >= 0; i--) {
        if (num[i] == '1')
            dec_value += base;
        base = base * 2.0;
    }
    return dec_value;
}

int main(){
    ios::sync_with_stdio(false);
    cin.tie(NULL);
    string N;
    cin >> N;
    long double n = 0.0;
    n = binaryToDecimal(N);
    long double i = 50.0, j = 0.0;
    long double n1 = pow(4.0, i);
    long double n2 = pow(4.0, j);
    while ((n1 >= n) && (n2 < n)){
        i--; j++;
        n1 = pow(4.0, i); n2 = pow(4.0, j);
    }
    if (n2 >= n)
        cout << j ;
    else if (n1 < n)
        cout << i ;
    return 0;
}
