    long double n2 = pow(4.0, j);
    while ((n1 > n) && (n2 <= n)){
        i--; j++;
        n1 = pow(4.0, i); n2 = pow(4.0, j);
    }
    if (n2 > n)
        cout << j ;
    else if (n1 <= n)
        cout << i ;
    return 0;
}
