ll isfind(ll parent[], ll b)
{

    if (parent[b] == b)
    {
        return b;
    }

    parent[b] = isfind(parent, parent[b]);
    return parent[b];
}
void build(ll tree[], ll arr[], ll node, ll start, ll end)
{

    if (start == end)
    {
        tree[node] = arr[start];
        return;
    }
    ll mid = (start + end) / 2;

    build(tree, arr, 2 * node, start, mid);

    build(tree, arr, 2 * node + 1, mid + 1, end);

    tree[node] = tree[2 * node] | tree[2 * node + 1];
}
ll range_in_query(ll tree[], ll node, ll start, ll end, ll l, ll r)
{

    if (start > end || start > r || end < l)
    {

        return 0;
    }
    if (start >= l && end <= r)
    {
        return tree[node];
    }
    ll mid = (start + end) / 2;
    ll range = range_in_query(tree, 2 * node, start, mid, l, r);
    ll range1 = range_in_query(tree, 2 * node + 1, mid + 1, end, l, r);
    return range | range1;
}
ll power(ll x, ll y, ll p)
{

    ll res = 1;
    x = x % p;
    while (y > 0)
    {
        if (y & 1)
            res = (res * x) % p;

        y = y >> 1; // y = y/2
        x = (x * x) % p;
    }
    return res;
}
