long long mnsum(int n){
    int i=2;
    long long res=0;
    for(int j=1;j<=n;i*=2,j++){
        res+=i;
    }
    return res;
}
long long mxsum(int n){
    long long res=1;
    for(int i=2,j=1;j<n;j++,i*=2)
        res+=i;
    return res;
}
int main(){
    long long mnres=0,mxres=0;
    int n,l,r;
    cin>>n>>l>>r;
    l--;r--;
    mnres+=(mnsum(l)+(n-l));
    mxres+=mxsum(r)+(n-r)*pow(2,r);
    cout<<mnres<<" "<<mxres<<"\n";
    return 0;
}']

