#include <iostream>
using namespace std;
int d[110][110], ans[1000100], p[1000100];
const int inf = 1e5;

int main(){
    int n;
    cin >> n;
    for(int i = 1; i <= n; i ++){
        for(int j = 1; j <= n; j ++){
            char c;
            cin >> c;
            if(c == '1'){
                d[i][j] = 1;
            }else{
                d[i][j] = inf;
            }
            if(i == j){
                d[i][j] = 0;
            }
        }
    }

    // finding path
    for(int i = 1; i <= n; i ++){
        for(int j = 1; j <= n; j++){
            if(i != j){
                for(int k = 1; k <= n; k ++){
                    if(i != j && j != k) {
                        d[i][j] = min(d[i][j], d[i][k] + d[k][j]);
                    }
                }
            }
        }
    }

    int m, cnt = 0;
    cin >> m;
    for(int i = 1; i <= m; i++){
        cin >> p[i];
    }
    ans[++cnt] = p[1];
    int dist = 0;
    for(int i = 2; i <= m; i++){
        dist += d[p[i-1]][p[i]];
        if(dist > d[ans[cnt]][p[i]]){
            ans[++cnt] = p[i-1];
            dist = d[ans[cnt]][p[i]];
        }
    }
    ans[++cnt] = p[m];
    cout << cnt << endl;
    for(int i = 1; i <= cnt; ++i)
        cout << ans[i] << ' ';
    cout << endl;

    return 0;
}"]

