inline int getcmin(int t) {
	return n - t + (1 << t) - 1;
}
inline int getcmax(int t) {
	return (n - t) * (1 << (t - 1)) + (1 << t) - 1;
}
inline int getmin() {
	int ans = getcmin(l);
	for (int i = l + 1; i <= r; ++i) {
		ans = min(getcmin(i), ans);
	}
	return ans;
}
inline int getmax() {
		int ans = getcmax(l);
	for (int i = l + 1; i <= r; ++i) {
		ans = max(getcmax(i), ans);
	}
	return ans;
}
int main() {
	cin >> n >> l >> r;
	cout << getmin() << ' ' << getmax() << endl; 
	return 0;
}"]

