['#include <bits/stdc++.h>
#define ll long long int
using namespace std;

ll exp(ll a, ll p )
{
    ll result = 1;
    if(p==0)
        return 1;
    if(p==1)
        return a;
    while(p)
    {
        if(p&1)
            result *= a;
        p >>=1;
        a*=a;
    }
    return result;
}
int main() 
{
    ll n,l,r;
    cin>>n>>l>>r;
    ll mini = exp(2,l)-1+(n-l);
    ll maxi = exp(2,r)-1+(n-r)*exp(2,r-1);
    cout<<mini<<" "<<maxi;
}']

