['#include <bits/stdc++.h>
using namespace std;

int main(){
	ios::sync_with_stdio(0);cin.tie(0);cout.tie(0);
	int n;
	cin >> n;
	vector<vector<long long> > dist(n,vector<long long>(n,200));
	
	for(int i=0;i<n;i++){
		for(int j=0;j<n;j++){
			char x;
			cin >> x;
			int y = x-'0';
			if(y) dist[i][j] = 1;
		}
	}
	

	for(int k = 0;k<n;k++){
		for(int i=0;i<n;i++){
			for(int j=0;j<n;j++){
				if(dist[i][j]>dist[i][k]+dist[k][j]) dist[i][j] = dist[i][k]+dist[k][j];
				if(i==j) dist[i][j] = 0;
			}

		}
	}
	int k;
	cin >> k;

	vector<int> ans;

	vector<int> query(k);
	for(int i=0;i<k;i++){
		cin >> query[i];
	}
	ans.push_back(0);
	for(int i=1;i<k;i++){
		long long is = i-ans.back();
		long long shouldBe = dist[query[ans.back()]-1][query[i]-1];
		if(shouldBe<is){
			ans.push_back(i-1);
		}
	}
	ans.push_back(k-1);

	cout << ans.size() << endl;
	for(auto i:ans) cout << query[i] << " ";
	return 0;
}']

