using namespace std;
int convertBinaryToDecimal(long long n)
{
    int decimalNumber = 0, i = 0, remainder;
    while (n!=0)
    {
        remainder = n%10;
        n /= 10;
        decimalNumber += remainder*pow(2,i);
        ++i;
    }
    return decimalNumber;
}
int i,l;
int main()
{
    long long n,x;
    cin>>n;
    x=convertBinaryToDecimal(n);
    for(;l<x;i++){
        l=pow(4,i);
    }
    cout<<i-1;
    return 0;
}
