    			maxi = maxi + pow ( 2 , i ) ; 
    		}
    		for ( ll i = 0 ; i < l ; i ++ )
    		{
    			mini= mini + pow ( 2 , i ) ; 
    		}
    		cout << mini << " " << maxi << endl ; 
    		
}']

