int Pow(int a,int b)
{
    int s=1;
    for(int i=0;i<b;i++)
        s*=a;
    return s;
}

int main()
{
    string s;
    int i,ans=0;
    getline(cin,s);
    for(i=s.length()-1;i>=0;i--)
    {
        int x=s[i]-48;
        if(x==1)ans+=Pow(2,s.length()-1-i);
        //cout<<ans<<" ";
    }
    ans=log10(ans-1)/log10(4);
    cout<<ans+1<<endl;
    return 0;
}
