    for(int i=0;i<s.length();i++)
    {
        if(s[i] == '1') st.push(i);
        else if(!st.empty()) st.pop();
    }

    while(!st.empty())
    {
        s[st.top()] = '0';
        st.pop();
    }
    cout<<s<<endl;
}

int main()
{
    fast();
    cin>>s;
    solve();
}']

