const int maxN = 107;

int d[maxN][maxN];
int n;

void apsp()
{
	for (int k = 1; k <= n; k++)
	{
		for (int i = 1; i <= n; i++)
		{
			for (int j = 1; j <= n; j++)
			{
				if (d[i][j] >= d[i][k] + d[k][j])
				{
					d[i][j] = d[i][k] + d[k][j];
				}
			}
		}
	}
}

signed main()
{
	ios_base::sync_with_stdio(false);
	cin.tie(0);
	cout.tie(0);
	memset(d, 0x3f, sizeof(d));
	cin >> n;
	for (int i = 1; i <= n; i++)
	{
		d[i][i] = 0;
		for (int j = 1; j <= n; j++)
		{
			char ch;
			cin >> ch;
			d[i][j] = (ch == '1') ? 1 : d[i][j];
		}
	}
	apsp();
	int m, save = 0;
	cin >> m;
	int p[m];
	vector<int> ans;
	for (int i = 0; i < m; i++)
	{
		cin >> p[i];
	}
	for (int i = 0; i < m; i++)
	{
		if (i == 0)
		{
			ans.emplace_back(p[i]);
		}
		else
		{
			int pick = ans.back();
			if (d[pick][p[i]] < i - save)
			{
				ans.emplace_back(p[i - 1]);
				save = i - 1;
			}
		}
	}
	ans.emplace_back(p[m - 1]);
	cout << ans.size() << endl;
	for (auto num : ans)
	{
		cout << num << " ";
	}
}']

