['import java.util.*;
import java.io.*;
import java.math.*;

public class codechef {
    public static class InputReader {
        private final InputStream stream;
        private final byte[] buf = new byte[8192];
        private int curChar, snumChars;

        public InputReader(InputStream st) {
            this.stream = st;
        }

        public int read() {
            if (snumChars == -1)
                throw new InputMismatchException();
            if (curChar >= snumChars) {
                curChar = 0;
                try {
                    snumChars = stream.read(buf);
                } catch (IOException e) {
                    throw new InputMismatchException();
                }
                if (snumChars <= 0)
                    return -1;
            }
            return buf[curChar++];
        }

        public int nextInt() {
            int c = read();
            while (isSpaceChar(c)) {
                c = read();
            }
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            int res = 0;
            do {
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isSpaceChar(c));
            return res * sgn;
        }

        public long nextLong() {
            int c = read();
            while (isSpaceChar(c)) {
                c = read();
            }
            int sgn = 1;
            if (c == '-') {
                sgn = -1;
                c = read();
            }
            long res = 0;
            do {
                res *= 10;
                res += c - '0';
                c = read();
            } while (!isSpaceChar(c));
            return res * sgn;
        }

        public int[] nextIntArray(int n) {
            int a[] = new int[n];
            for (int i = 0; i < n; i++) {
                a[i] = nextInt();
            }
            return a;
        }

        public String readString() {
            int c = read();
            while (isSpaceChar(c)) {
                c = read();
            }
            StringBuilder res = new StringBuilder();
            do {
                res.appendCodePoint(c);
                c = read();
            } while (!isSpaceChar(c));
            return res.toString();
        }

        public String nextLine() {
            int c = read();
            while (isSpaceChar(c))
                c = read();
            StringBuilder res = new StringBuilder();
            do {
                res.appendCodePoint(c);
                c = read();
            } while (!isEndOfLine(c));
            return res.toString();
        }

        public boolean isSpaceChar(int c) {
            return c == ' ' || c == '\n' || c == '\r' || c == '\t' || c == -1;
        }

        private boolean isEndOfLine(int c) {
            return c == '\n' || c == '\r' || c == -1;
        }
    }

    static class pair {
        public long x1;
        public long x2;

        pair(long x, long y) {
            this.x1 = x;
            this.x2 = y;
        }
    }

    public static long[][] floydWarshall(long[][] g) {
        int n = g.length;
        for (int k = 0; k < n; k++) {
            for (int i = 0; i < n; i++) {
                for (int j = 0; j < n; j++) {
                    if (g[i][j] > g[i][k] + g[k][j]) {
                        g[i][j] = g[i][k] + g[k][j];
                    }
                }
            }
        }
        return g;
    }

    public static void main(String[] args) throws IOException {
        InputReader in = new InputReader(System.in);
        PrintWriter out = new PrintWriter(System.out);
        int n = in.nextInt();
        int inf = (int) 1e9;
        long g[][] = new long[n + 1][n + 1];
        for (long a[] : g) Arrays.fill(a, inf);
        for (int i = 1; i <= n; i++) {
            char s[] = in.nextLine().toCharArray();
            for (int j = 1; j <= n; j++) {
                g[i][j] = (s[j - 1] - '0');
                if (g[i][j] == 0) g[i][j] = inf;
            }
            g[i][i] = 0;
        }
        g = floydWarshall(g);
        int m = in.nextInt();
        int a[] = new int[m];
        for (int i = 0; i < m; i++) {
            a[i] = in.nextInt();
        }
        int src = a[0], dst = a[m - 1], sid = 0, tmpID = 0;
        ArrayDeque<Integer> dq = new ArrayDeque<>();
        dq.addLast(src);
        for (int i = 1; i < m; i++) {
            int d = i - sid;
            long f = g[src][a[i]];
            if (d == f) {
                tmpID = i;
            } else {
                src = a[tmpID];
                sid = tmpID;
                tmpID = i;
                dq.addLast(src);
            }

            if (i == m - 1) {
                dq.addLast(a[i]);
            }
        }

        out.println(dq.size());
        for (int i : dq) out.print(i + " ");
        out.println();
        out.flush();
    }

}']

