using namespace std;
int n,dp[101][101],m,b[1000006];
string s[101];
void solve(){
    cin>>n;
    rep(i,0,n) cin>>s[i];
    rep(i,0,n){
        rep(j,0,n){
            dp[i+1][j+1]=s[i][j]-'0';
            if(dp[i+1][j+1]==0) dp[i+1][j+1]=hell;
        }
    }
    rep(k,1,n+1){
        rep(i,1,n+1){
            rep(j,1,n+1){
                dp[i][j]=min(dp[i][k]+dp[k][j],dp[i][j]);
            }
        }
    }
    cin>>m;
    rep(i,0,m) cin>>b[i];
    vi v;
    int cur=0;
    v.pb(b[cur]);
    rep(i,1,m){
        if(dp[b[cur]][b[i]]!=i-cur){
            v.pb(b[i-1]);
            cur=i-1;
            i--;
        }
