ll gcd(ll a,ll b) 
{
	if(a == 0)
		return b;
	return gcd(b%a, a);
}

ll lcm(ll a, ll b)  
{  
    return (a*b)/gcd(a, b);  
}

ll binarytodec(string n)
{
	string hj=n;
	ll ans=0;ll base=1;
	for(ll i=hj.size()-1;i>=0;i--)
	{
		if(hj[i]=='1')
			ans=ans+base;
		base=base*2;
	}
