		comb[i][j] = (comb[i - 1][j - 1] + comb[i - 1][j]) % mod;
	for (int i = 1; i < maxn / 2; i++) p[0][i] = 1;
	for (int i = 1; i < maxn / 2; i++) 	for (int j = i; j < maxn / 2; j++)
		p[i][j] = (p[i - 1][j] + p[i][j - 1]) % mod;
}
int dp[maxn >> 1][maxn >> 1];
int main() {
	init();
	int n, m; scanf("%d%d", &n, &m);
	for (int i = 1; i <= n; i++) dp[i][0] = i;
	for (int i = 1; i <= n; i++)
		for (int j = 1; j <= m; j++)
			dp[i][j] = max(dp[i][j],
			((dp[i - 1][j] + comb[i + j - 1][j]) % mod +
				((dp[i][j - 1] - comb[i + j - 1][i] + p[i][j - 1]) % mod + mod) % mod) % mod);
	printf("%d\n", dp[n][m]);
}
