void g_b_n(string &s, long long &num){
    int n = s.size() - 1;
    for (int i = 0; i < s.size(); ++i)
        if (s[i]=='1') num += pow(2, n-i);
}
long long logn(double base, double x) {
    return ceil(log(x) / log(base));
}
int main()
{
    string s; cin>>s; long long num=0;
    g_b_n(s, num);
    cout<<logn(4, num);

    return 0;
}
