	queue<ll> q;
	q.push(st);
	dist[st] = 0;
	used[st] = true;
	while (!q.empty()) {
		ll cur = q.front();
		q.pop();
		for (int i = 0; i < n; i++) {
			if (!used[i] && matr[cur][i]) {
				dist[i] = dist[cur] + 1;
				par[i] = cur;
				q.push(i);
				used[i] = true;
			}
		}
	}
}
