		par[i] = -1;
	}
	for (int i = 0; i < n; i++) {
		for (int j = 0; j < n; j++) {
			char c;
			cin >> c;
			matr[i][j] = c - '0';
			if (i == j) matr[i][j] = 1;
		}
	}

	ll m;
