		ind[i] = i;
		ansVec[i] = vec[i];
	}

	ll cnt = 0, lastFine = m - 1;
	for (int i = m - 1; i >= 2; i--) {
		ll i1 = lastFine, i2 = i - 1, i3 = i - 2;
		if (matr[vec[i2]][vec[i1]] && matr[vec[i3]][vec[i2]] && !matr[vec[i3]][vec[i1]]) {
			ind[i2] = i1;
			vec[lastFine] = vec[i2];
			vec[i2] = -1;
			ansVec[i2] = -1;
			cnt++;
		}
		else {
			ll i23 = i - 1;
			lastFine = i23;
			while (vec[i23] == -1 && i23 > 0) {
				i23--;
				lastFine = i23;
			}
		}
	}

	cout << vec.size() - cnt << "\n";
	for (int i = 0; i < vec.size(); i++) {
		if (ansVec[i] != -1) cout << ansVec[i] + 1 << " ";
	}
	return 0;
}']

