	for (int i = 1; i <= n; ++i)
	{
		string s;
		cin >> s;
		for (int j = 1; j <= n; ++j)
		{
			adj[i][j] = s[j - 1] - '0';
		}
	}
	int m;
	cin >> m;
	for (int i = 1; i <= m; ++i)
	{
		cin >> a[i];
	}
	Floyd(n);
	vector<int> ans = { a[1] };
	int source = a[1];
	int idx = 1;
	while (idx < m)
	{
		int target = -1;
		int dist = -INF;
		for (int i = 1; i <= n; ++i)
		{
			int cur = dp[source][i];
			if (cur > dist && idx + cur <= m && a[idx + cur] == i)
			{
				target = i;
				dist = cur;
			}
		}
		idx += dist;
		ans.push_back(a[idx]);
		source = target;
	}
	cout << ans.size() << '\n';
	for (int it : ans)
		cout << it << ' ';
	return 0;
}
