            d[i][0][1] = d[i - 1][0][1] + 1;
            d[i][1][1] = d[i - 1][1][1];
        }else{
            d[i][1][1] = max( d[i - 1][1][1] , d[i - 1][0][1] ) + 1;
            d[i][0][1] = d[i - 1][0][1];
        }
    }
    int res = max( d[n][0][1] , d[n][1][1] );
    for( int i = 1; i <= n; i++ ){
        z[i] = z[i - 1];
        a[i][0][0] += z[i];
        a[i][0][1] += z[i];
        if( s[i] == '1' ){
            int mx = max( d[i - 1][0][1] , d[i - 1][1][1] ) + a[i + 1][1][0];
            mx = max( mx , max( d[i + 1][0][0] , d[i + 1][1][0] ) + 1 + a[i - 1][0][1] );
            if( mx == res ){
                s[i] = '0';
                z[i] += 1;
                a[i][0][0] += 1;
                a[i][0][1] += 1;
            }
        }
    }
    for( int i = 1; i <= n; i++ ){
        cout << s[i];
    }
}

