ll dis[105][105], vis[105], dist[105];
string adj[105];
ll n, m, p[100005];
ll minDistance() 
{ 
    ll minn = LLONG_MAX, min_index; 

    for (int v = 0; v < n; v++) 
        if (vis[v] == 0 && dist[v] <= minn) 
            minn = dist[v], min_index = v; 

    return min_index; 
} 
void dijkstra(ll src) 
{  

    for (int i = 0; i < n; i++) 
    {
    	dist[i] = LLONG_MAX;
    	vis[i] = 0;
    } 
    dist[src] = 0; 

    for (int count = 0; count < n - 1; count++) { 
        // Pick the minimum distance vertex from the set of vertices not 
        // yet processed. u is always equal to src in the first iteration. 
        ll u = minDistance(); 

        // Mark the picked vertex as processed 
        vis[u] = 1; 

        // Update dist value of the adjacent vertices of the picked vertex. 
        for (int v = 0; v < n; v++) 
            if (!vis[v] && adj[u][v] == '1' && dist[u] != LLONG_MAX 
                && dist[u] + 1 < dist[v]) 
                dist[v] = dist[u] + 1; 
    }  
    for (int i = 0; i < n; ++i)
    {
    	dis[src][i] = dist[i];
    }
} 
