				ans[i] = j;
			}
		}
	}
	ll cur = m - 1;
	vll v;
	while (cur != -1)
	{
		v.pb(p[cur]);
		cur = ans[cur];
	}
	cout << v.size() << '\n';
	reverse(v.begin(), v.end());
	for (int i = 0; i < v.size(); ++i)
	{
