	int i = n-1;
	int z = 0;
	int o = 0;
	while (i >= 0) {
		if (s[i] == '0') {
			while(i >= 0 && s[i] == '0') {
				z++;
				i--;
			}
		} else {
			int j;
			for (j = i; j >= 0; --j) {
				if (s[j] == '0') break;
			}
