				int det = o+i-j-z;
				for (int k = 1; k <= det; ++k) {
					s[j+k] = '0';
				}
				o += i-j-det;
			} else {
				o += i-j;
			}
			i = j;
		}
	}
	cout<<s<<endl;
	return 0;
}
