int convertBinaryToDecimal(long long n)
{
    int decimalNumber = 0, i = 0, remainder;
    while (n!=0)
    {
        remainder = n%10;
        n /= 10;
        decimalNumber += remainder*pow(2,i);
        ++i;
    }
    return decimalNumber;
}
int main()
{
    string s;
     long long int t,mini,maxi,val,ans,i,n;
    cin>>s;
    n = atoi(s.c_str());
    val = convertBinaryToDecimal(n);
    i=0;
    n=1;
    while(1)
    {
        n = n*4;
        i++;
        if(n>=val)
            break;
    }
    cout<<i<<endl;
    return 0;
}


