void Floyd()
{
	for(int k=1;k<=N;k++)
	{
		for(int i=1;i<=N;i++)
		{
			for(int j=1;j<=N;j++)
			{
				d[i][j]=min(d[i][k]+d[k][j],d[i][j]);
			}
		}
	}
}
int main()
{
	char ch;
	cin>>N;
	for(int i=1;i<=N;i++)
	{
		for(int j=1;j<=N;j++)
		{
			cin>>ch;
			mp[i][j]=ch-'0';
			if(i==j)d[i][j]=0;
			else if(mp[i][j])d[i][j]=1;
					else d[i][j]=INF;
		}
	}
	Floyd();
	cin>>M;
	for(int i=1;i<=M;i++)cin>>p[i];
	ans[++num]=p[1];
	int tmp=0; 
	for(int i=2;i<=M;i++)
	{
		tmp+=d[p[i-1]][p[i]];
