#include <iostream>
#include <vector>

#define ll long long
#define e '\n'
using namespace std;

int pow(int x, int y) {
    if (y == 0)
        return 1;

    return x * pow(x, y - 1);
}

int BinToDec(string bin) {
    int dec = 0, mul = 1;
    for (int i = bin.size() - 1; i >= 0; i--) {
        dec  += (bin[i] - '0')*mul;
        mul *=2;
    }
    return dec;
}

int main() {
    ios::sync_with_stdio(false), cin.tie(nullptr), cout.tie(nullptr);
