['#include <bits/stdc++.h>
using namespace std;
#define MAXN 200009
typedef long long LL;
typedef pair<LL, LL> PII;
typedef pair<int, int> pii;
const LL MOD = 1e9 + 7;
class {
  public:
    char mp[111][111];
    int mpp[111][111];
    int n, m, p[1000009];
    bool P[1000009];
    void solve() {
        scanf("%d", &n);
        for (int i = 1; i <= n; ++i)
            scanf("%s", mp[i] + 1);
        for (int i = 1; i <= n; ++i)
            for (int j = 1; j <= n; ++j) {
                if (mp[i][j] == '1')
                    mpp[i][j] = 1;
                else
                    mpp[i][j] = MOD;
            }
        for (int k = 1; k <= n; ++k)
            for (int i = 1; i <= n; ++i)
                for (int j = 1; j <= n; ++j)
                    mpp[i][j] = min(mpp[i][j], mpp[i][k] + mpp[k][j]);
        scanf("%d", &m);
        for (int i = 1; i <= m; ++i) {
            scanf("%d", &p[i]);
        }
        int pre = 1, now = 2;
        vector<int> ans;
        while (1) {
            while (now <= m && mpp[p[pre]][p[now]] == now - pre) {
                now++;
            }
            now--;
            ans.push_back(p[pre]);
            if (pre != now)
                ans.push_back(p[now]);
            if (now == m)
                break;
            pre = now + 1;
            now = now + 2;
        }
        cout << ans.size() << "\n";
        for (int i : ans)
            cout << i << " ";
    }

} NSPACE;
