                    mpp[i][j] = 0;
                else
                    mpp[i][j] = MOD;
            }
        for (int k = 1; k <= n; ++k)
            for (int i = 1; i <= n; ++i)
                for (int j = 1; j <= n; ++j)
                    mpp[i][j] = min(mpp[i][j], mpp[i][k] + mpp[k][j]);
        scanf("%d", &m);
        for (int i = 1; i <= m; ++i) {
            scanf("%d", &p[i]);
        }
        int pre = 1, now = 2;
        vector<int> ans;
        ans.push_back(p[1]);
        while (1) {
            while (now <= m && mpp[p[pre]][p[now]] == now - pre) {
                now++;
            }
            now--;
            ans.push_back(p[now]);
            if (now == m)
                break;
            pre = now;
            now = now + 1;
        }
        cout << ans.size() << "\n";
        for (int i : ans)
            cout << i << " ";
    }

} NSPACE;
int main() {
#ifdef DEBUG
    freopen("in.txt", "r", stdin);
#endif
    ios_base::sync_with_stdio(false);
    cout.tie(0);
    cin.tie(0);
    NSPACE.solve();
}']

