    string num = n;
    long int dec_value = 0;

    // Initializing base value to 1, i.e 2^0
    long int base = 1;

    long int len = num.length();
    for (long int i = len - 1; i >= 0; i--) {
        if (num[i] == '1')
            dec_value += base;
        base = base * 2;
    }

    return dec_value;
}

