    long int n = binaryToDecimal(N);
    int i = 50, j = 0;
    while ((pow(4, i) > n) && (pow(4, j) < n)){
        i--; j++;
    }
    if (pow(4, i) <= n)
        cout << i;
    else
        cout << j;
    return 0;
}
