#define ll long long
#define ld long double
#define pll pair<ll,ll>
#define FILL(v,p) memset(v,p,sizeof v)
#define FIO ios::sync_with_stdio(NULL); cin.tie(NULL)
#define SZ(x) (int)x.size()
#define ALL(x) x.begin(), x.end()
#define PI acos(-1.0)

const ll MOD = 1000000007;
const ll INF = 2000000000000000001LL;
const ld EPS = 1e-9;
const ll MAX = 100005;

vector<ll> g[200];
bool vis[105];

bool bfs(ll x, ll y, ll media)
{
    FILL(vis,0);
    
    ll P[105]={0};
    
    queue<ll> q;
    q.push(x);
    vis[x]=1;
    
    while(!q.empty())
    {
        ll u = q.front();
        q.pop();
        
        for(ll v: g[u])
        {
            if(!vis[v])
            {
                vis[v]=1;
                P[v]=u;
                q.push(v);
            }
        }
    }
    
    while(y!=media && y)
        y= P[y];
    
    return (y == media);
}

int main()
{
    FIO;
    
    ll n, l, r;
    cin >> n;
    
    string s[300];
    
    for(int i=0;i<n;i++)
    {
        cin >> s[i];
        
        for(int j=0;j<n;j++)
        {
            if(s[i][j] == '1') g[i+1].push_back(j+1);
        }
    }
    
    //~ll p = 4;
    //~while(p!=1) cout << p << " ", p=par[1][p];
    //~cout << p << endl;
    
    ll m;
    cin >> m;
    
    vector<ll> go(m), ans;
    
    for(int i=0;i<m;i++) cin >> go[i];
    
    ans.push_back(go[0]);
    
    for(int i=1;i<m-1;i++)
    {
        if(go[i+1] != ans.back())
            if(bfs(ans[0],go[i+1], go[i])) continue;
            
        ans.push_back(go[i]);
    }
    
    ans.push_back(go[m-1]);
    
    cout << ans.size() << endl;
    for(ll p: ans) cout << p <<" ";
    
    
    
    return 0;
}
