long long int  decimal(long long int num)
{
   long long int i=0,sum=0,rem;
   while (num>0)
   {
       rem=num%10;
       sum=sum+rem*pow(2,i);
       num=num/10;
       i++;
   }
   return sum;
}
int  main ()
{
    long long int num,dec,j,m=0,cont=0;
    cin>>num;
    dec=decimal(num);
    j=0;
    while (m<dec)
    {
        m=0;
        m=pow(4,j);
        j++;
        if (m<dec) cont++;
    }
    cout<<cont<<endl;
    return 0;
}
