#define REP(i, a, b) for (int i = (a); i <= (b); ++i)
#define FOR(i, a, b) for (int i = (a); i < (b); ++i)
#define FORD(i, a, b) for(int i = (a); i > (b); --i)
#define REPD(i, a, b) for(int i = (a); i >=(b); --i)
#define TR(it, a) for(__typeof(a.begin()) it = a.begin(); it != a.end(); ++it)
#define endl '\n'
#define mp make_pair
#define pb push_back
#define unmap unordered_map
using namespace std;

typedef long long ll;
typedef pair <ll, ll> pll;
const ll limit = 1e6 + 1;
const ll maxN = 1e18;
const ll minN = -1e18;
const ll MOD = 1e9 + 7;

string s;

ll power(ll x, ll n) {
    if (n == -1) return 1;
    if (n == 0) return 1;
    if (n == 1) return x;
    ll temp = power(x, n / 2);
    if (n % 2 == 0) return temp * temp;
    else return temp * temp * x;
}

ll binToDec(string s) {
    ll res = 0;

    FOR(i, 0, s.length()) {
        res = res * 2 + (s[i] - '0');
    }

    return res;
}

void solveProblem() {
    ll temp = binToDec(s);
    ll cnt = 0;

    REP(i, 0, 1e9) {
        if (power(4, i) < temp) cnt++;
        else break;
    }
    cout << cnt << endl;
}

void fastInput() {
    ios_base::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);
}

void readInput() {
    cin >> s;
}

int main() {
    fastInput();
    readInput();
    solveProblem();
}

