    while(!Q.empty()){
        int u = Q.front();
        Q.pop();
        for(auto v : adj[u])
            if(dist[src][v] == -1)
                Q.push(v), dist[src][v] = 1 + dist[src][u];
    }
}
int main(){FIN;
