int main()
{
    ios_base::sync_with_stdio(false);
    long N;
    cin >> N;

    vector<vector<long>> F(N + 1, vector<long>(N + 1, oo));
    for (long i = 1; i <= N; ++i)
    {
        for (long j = 1; j <= N; ++j)
        {
            char ch;
            cin >> ch;
            if (ch == '1')
                F[i][j] = 1;
        }
        F[i][i] = 0;
    }

    long M, Last, Dest;
    cin >> M >> Last;
    vector<long> P(M - 2);
    for (long &x : P) cin >> x;
    cin >> Dest;

    if (Last == Dest)
    {
        cout << M << endl;
        for (long &x : P) cout << x << ' ';
        cout << endl;
        return 0;
    }

    for (long i = 1; i <= N; ++i)
        for (long j = 1; j <= N; ++j)
            for (long k = 1; k <= N; ++k)
                F[i][j] = min(F[i][j], F[i][k] + F[k][j]);

    vector<long> Answer(1, Last);
    for (long &x : P)
        if (F[Last][x] + F[x][Dest] > F[Last][Dest])
        {
            Answer.push_back(x);
            Last = x;
        }
    Answer.push_back(Dest);

    cout << Answer.size() << endl;
    for (long &x : Answer) cout << x << ' ';
    cout << endl;
}
