    vector<vector<long>> F(N + 1, vector<long>(N + 1, oo));
    for (long i = 1; i <= N; ++i)
    {
        for (long j = 1; j <= N; ++j)
        {
            char ch;
            cin >> ch;
            if (ch == '1')
                F[i][j] = 1;
        }
        F[i][i] = 0;
    }

    long M, Last = 0;
    cin >> M;
    vector<long> P(M);
    for (long &x : P) cin >> x;

    for (long i = 1; i <= N; ++i)
        for (long j = 1; j <= N; ++j)
            for (long k = 1; k <= N; ++k)
                F[i][j] = min(F[i][j], F[i][k] + F[k][j]);

    vector<long> Answer(1, P[0]);
    Last = 0;
    for (long i = 2; i < P.size(); ++i)
        if (F[Answer.back()][P[i]] < i - Last)
        {
            Answer.push_back(P[i - 1]);
            Last = i - 1;
        }
    Answer.push_back(P.back());

    cout << Answer.size() << endl;
    for (long &x : Answer) cout << x << ' ';
    cout << endl;
}
