int main()
{
	int n;scanf("%d",&n);
	for(int i=1;i<=n;i++){
		for(int j=1;j<=n;j++)
			if(i!=j)	e[i][j]=1e9;
	}
	for(int i=1;i<=n;i++){
		scanf("%s",s+1);
		for(int j=1;j<=n;j++)
			if(s[j]=='1')	e[i][j]=1;
	}
	for(int k=1;k<=n;k++){
		for(int i=1;i<=n;i++)
			for(int j=1;j<=n;j++)
				e[i][j]=min(e[i][j],e[i][k]+e[k][j]);
	}
	for(int k=1;k<=n;k++){
		for(int i=1;i<=n;i++)
			for(int j=1;j<=n;j++){
				if(i!=k&&j!=k&&i!=j&&e[i][j]==e[i][k]+e[k][j])
					bk[i][k][j]=true;
			}
	}
//	for(int i=1;i<=n;i++)
//		for(int j=1;j<=n;j++)
//			cout<<e[i][j]<<endl;
	int m;scanf("%d",&m);
	for(int i=1;i<=m;i++)
		scanf("%d",&num[i]);
	int tot=0,ls=0;
	for(int i=1;i<=m;i++){
		if(bk[ls][num[i]][num[i+1]])
			continue;
		ls=num[i];
		ans[tot++]=num[i];
	}
	printf("%d\n",tot);
	for(int i=0;i<tot;i++){
		printf("%d",ans[i]);
		if(i!=tot-1)	printf(" ");
	}
}']

