    string s;
    cin >> s;
 
    int n = s.size();
 
    int col1 = 0;
 
    if (s == "0") { cout << 0 << '\n'; return; }
 
    for (int i = 0; i < n; ++i) {
        if (s[i] == '1') { ++col1; }
    }
 
    if (col1 == 1) { cout << n / 2; }
    else { cout << (n + 1) / 2; }
 
