["#include <bits/stdc++.h>

using namespace std;

int TN = 1;

void sol () {

    long long n;
    long long l;
    long long r;

    cin >> n >> l >> r;

    long long ans1 = 0;
    long long ans2 = 0;

    for (int i = 0; i < l; ++i) { ans1 += pow (2, i); ans2 += pow (2, i); }

    ans1 += (n - l);

    for (int i = l; i < r; ++i) { ans2 += pow (2, i); }

    ans2 += (n - r) * pow (2, r - 1);

    cout << ans1 << ' ' << ans2;

}

int main () {

    ///cin >> TN;

    for (int i = 0; i < TN; ++i) { sol (); }

    return 0;

