			if (mat[i][j] == 1) count[i]++;
		}
	}
	
	cin >> m;
	
	vector<int> p(m), v;
	for (int i = 0; i < m; i++) cin >> p[i], p[i]--;
	
	v.push_back(p[0] + 1);
	
	for (int i = 0; i < m - 2; i++) {
		for (int j = i + 2; j < m && p[j] != p[i]; j++) {
			if (mat[p[i]][p[j]]) {
