['#include<bits/stdc++.h>
using namespace std;
long long int dist[105][105],n;
#define INF 1000000
void shortest_path()
{
	long long int i=0,j,k,z;
	for(i=1;i<=n;i++)
	{
		for(j=1;j<=n;j++)
		{
			for(k=j;k<=n;k++)
			{
				z=dist[j][i]+dist[i][k];
				if(z<dist[j][k])
				{
					dist[j][k]=z;
				}
			}
		}
	}
}
int main()
{
	long long int i,j,x,m,last,d,k=0;
	vector<long long int> v,ans;
	cin>>n;
	string s;
	for(i=1;i<=n;i++)
	{
		for(j=1;j<=n;j++)
		{
			if(i!=j)
			dist[i][j]=INF;
			else
			dist[i][j]=0;
		}
	}
	for(i=1;i<=n;i++)
	{
		cin>>s;
		for(j=0;j<n;j++)
		{
			if(s[j]=='1')
			{
				dist[i][j+1]=1;
			}
		}
	}
	cin>>m;
	for(i=0;i<m;i++)
	{
		cin>>x;
		v.push_back(x);
	}
	shortest_path();
	ans.push_back(v[0]);
	last=v[0];
	d=0;
	k=1;
	for(i=1;i<m;i++)
	{
		d++;
		x=v[i];
		if(dist[last][x]<d)
		{
			d=1;
			ans.push_back(v[i-1]);
			last=v[i-1];
			k++;
		}
	}
	if(v[m-1]!=last)
	{
		ans.push_back(v[m-1]);
	}
	k++;
	cout<<k<<"\n";
	for(i=0;i<k;i++)
	{
		cout<<ans[i]<<" ";
	}
}
