    var minArray = mutableListOf<Int>()
    var maxArray = mutableListOf<Int>()
    (1..n - (l - 1)).forEach {
        minArray.add(1)
    }

    var j = 1
    (1..l-1).forEach{
        j*=2
        minArray.add(j)
    }

    var distinct = 1;
    var k = 1
    for (i in 1..n){
        if (distinct<=r-1){
            maxArray.add(k)
            k*=2
            distinct++
        }else{
            maxArray.add(k)
        }
    }
    println("${minArray.sum()} ${maxArray.sum()}")
}

