struct trie{
	trie* child[26]; bool isLeaf;

	trie(){ mem(child, 0); isLeaf = 0; }

	void add(char *str){
		if (*str == '\0') isLeaf = 1;
		else {
			int cur = *str - 'a';
			if (child[cur] == 0) child[cur] = new trie();
			child[cur]->add(str + 1);
		}
	}
	bool search(char *str){
		if (*str == '\0') return isLeaf;
		int cur = *str - 'a';
		if (child[cur] == 0) return 0;
		return child[cur]->search(str + 1);
	}
	bool prefix(char *str){
		if (*str == '\0') return 1;
		int cur = *str - 'a';
		if (child[cur] == 0) return 0;
		return child[cur]->prefix(str + 1);
	}
	bool print(char *str) {
		if (*str == '\0') { return 1; }
		int cur = *str - 'a';
		if (child[cur] == 0) return 0;
		return child[cur]->prefix(str + 1);
	}

	

};

