int binaryToDecimal(int n)
{
    int num = n;
    int dec_value = 0;

    // Initializing base value to 1, i.e 2^0
    int base = 1;

    int temp = num;
    while (temp) {
        int last_digit = temp % 10;
        temp = temp / 10;

        dec_value += last_digit * base;

        base = base * 2;
    }

    return dec_value;
}
bool check(int n)
{
    int pro = 1;
    int i = 0;
    while(i++)
    {
        if(n==pro)
        {
            return true;
        }
        if(pro>n)
        {
            return false;
        }
        pro *= 4;
    }
}

int main()
{
    ios_base::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);
    int n,count=0;
    cin >> n;
    int num = binaryToDecimal(n);
    if(check(num))
    {
        while(num/4!=0)
        {
            count++;
            num /= 4;
        }
        cout << count << endl;
    }
    else
    {
        while(num/4!=0)
        {
            count++;
            num /= 4;
        }
        cout << count+1 << endl;
    }

    return 0;
}
