using namespace std;
int minim(int l)
{
    int sum=1;
    for(int i=1;i<l;i++)
    {
        sum=sum+2*i;
    }
    return sum;
}
int maxum(int n,int r)
{
    int sum=1;
    int i=1;
    n--;
    r--;
    while(n>0&&r>0)
    {
       sum=sum+(i*2);
       r--;
       n--;
       i=i*2;
    }
    if(n!=0)
    {
        sum=sum+(n*2);
    }
    return sum;
}
int main()
{
    int n,l,r;
    cin>>n>>l>>r;
    int mins=0,maxs=0;
    mins=n-l+minim(l);
    cout<<mins;
    maxs=maxum(n,r);
    cout<<" "<<maxs;
}
