['#include <bits/stdc++.h>

using namespace std;

int minimal(int n,int l,int r){
	int ans=0;
	if(n>l){
		ans+=n-l;
		ans+=(1<<l)-1;
	}
	else{
		ans+=(1<<n)-1;
	}
	return ans;
}

int maximum(int n,int l,int r){
	int ans=0;
	ans+=(1<<r)-1;
	ans+=(n-r)*(1<<r-1);
	return ans;
}

int main(){
	int n,l,r;
	cin>>n>>l>>r;
	cout<<minimal(n,l,r)<<" "<<maximum(n,l,r)<<endl;
	return 0;
}']

