{
    bool vist[105]={};
    vist[node]=1;
   queue<pair<int,int>>q;
    for(int i=0;i<n;i++)
    {
        if(s[node][i]=='1')
        {
            q.push({i,1});
           dis[node][i]=1;
           vist[i]=1;

        }

    }


    while(q.size())
    {
        int no=q.front().first,cost=q.front().second;
        q.pop();
        for(int i=0;i<n;i++)
        {
            if(s[no][i]=='1'&&!vist[i])
            {
                  q.push({i,cost+1});
                    dis[node][i]=cost+1;
                    vist[i]=1;
            }
        }

    }




}

