    for(int i=0;i<m;i++)
        {
            int x;
            cin>>x;
            x--;
            q.push(x);

        }
        dq.push_back(q.front());
        q.pop();
        while(q.size())
        {

            int x=q.front();
            q.pop();
            if(q.size())
            {
                int dis1=dis[dq.back()][q.front()];
