['#include<bits/stdc++.h>

#define N 105

#define fi first

#define sc second

using namespace std;

typedef pair<int , int> II;

int amount;

char graph_connect[N];

vector<int> graph_map[N];

int path;

int path_form[1000005] , color[N] , run = 0 ;

int dist[N][N];

int wait_row[N] , mem = 0;

void DFS( int start , int root )
{

    int Left = 1 , Right = 0;

    wait_row[++Right] = start;

    while( Left <= Right ){

        int spot = wait_row[Left++];

        for(int connect : graph_map[spot] ){

            if( color[connect] != run ){

                color[connect] = run;

                dist[root][connect] = dist[root][spot] + 1;

                wait_row[++Right] = connect;
            }
        }
    }
}

int result_row[1000005] , min_length = 0;

void solve()
{

    for(int i =1 ;i <= amount; i++)

        run = i , DFS( i , i );

    result_row[++min_length] = path_form[1];

    for(int i = 2; i < path; i++){

    int spot = result_row[min_length];

    bool special = ( result_row[min_length] == path_form[i+1] );

    if( dist[spot][ path_form[i] ] +1 != dist[spot][ path_form[i+1] ] || special )

        result_row[++min_length] = path_form[i];

    }

    result_row[++min_length] = path_form[path];

    printf("%d\n", min_length );

    for(int i =1 ;i <= min_length; i++)

        printf("%d ", result_row[i] );
}

int main()
{
    //freopen("main.inp", "r", stdin );

    scanf("%d", &amount );

    for(int i =1 ;i <= amount; i++){

        scanf("%s", graph_connect +1 );

        for(int j = 1 ; j <= amount; j++)

            if( graph_connect[j] == '1' )

            graph_map[i].push_back( j );
    }

    scanf("%d", &path );

    for(int i =1 ;i <= path; i++)

        scanf("%d", &path_form[i] );

    solve();
}
']

