{
    for(int i=0;i<=n+m-1;i++)
    {
        comb[i][0]=1;
        comb[i][i]=1;
    }
    for(int i=1;i<=n+m-1;i++)
        for(int j=1;j<i;j++)
            comb[i][j]=(comb[i-1][j]+comb[i-1][j-1])%mod;
}
