{
    cin>>n>>m;
    gencomb();
    for(int x=0; x<=n; x++)
        for(int y=0; y<=m; y++)
        {
            if(!x)
                cnt[x][y]=1;
            else
            {
                if(x>y)
                    cnt[x][y]=0;
                else
                    cnt[x][y]=(cnt[x-1][y]+cnt[x][y-1])%mod;
            }
        }

    for(int x=0;x<=n;x++)
    {
        for(int y=0;y<=m;y++)
        {
            if(x==0)
                dp[x][y]=0;
