                if(y==0)
                    dp[x][y]=x;
                else
                {
                    dp[x][y]=comb[x+y-1][y] + dp[x-1][y] + dp[x][y-1] - comb[x+y-1][x] + cnt[x][y-1];
                    if(dp[x][y]<0)
                        dp[x][y]+=mod;
                    dp[x][y]%=mod;
                }

            }
        }
    }
    cout<<dp[n][m];
    return 0;
}
