#include<bits/stdc++.h>
using namespace std;
typedef long long ll;
int adjlst[101][101];
int closest(int arr,vector<int>&visited){
	int ps = 0;
	int dist = 512;	
	for(int i = 0; i < visited.size(); ++i){
		if(!visited[i] && adjlst[arr][i] < dist){
			dist = adjlst[arr][i];
			ps = i;
		}
	}
	return ps;
}
void update(int i,int pos,vector<int>&visited){
	for(int j = 0; j < (int)visited.size(); ++j){
		if(!visited[j] && adjlst[pos][j] == 1 && adjlst[i][j] > adjlst[i][pos]+1){
			adjlst[i][j] = adjlst[i][pos]+1;
		}
	}
}
void Djikstra(int i,vector<int>visited){
	for(int k = 0; k < (int)visited.size();++k){
		int nxtvst = closest(i,visited);
		visited[nxtvst] = 1;
		update(i,nxtvst,visited);
	}
}
int main(){
	int n;
	cin>>n;
	for(int i = 0; i < n; i++){
		for(int j = 0; j < n; j++){
			char tmp;
			cin>>tmp;
			if(tmp == '1'){
				adjlst[i][j] = 1;
			}
			else if(i == j){
				adjlst[i][j] = 0;
			}
			else{
				adjlst[i][j] = 500;
			}
		}
	}
	for(int i = 0; i < n; ++i){
		vector<int>visited(n);
		Djikstra(i,visited);
	}
	/*for(int i = 0; i < n; i++){
		for(int j = 0; j < n; ++j)cout<<adjlst[i][j]<<" ";
		cout<<"\n";
	}*/
	int m;
	cin>>m;
	vector<int>pth(m);
	for(int i = 0; i < m; i++){
		cin>>pth[i];
		pth[i]--;
	}
	bool change = 1;
	while(change){
		change = 0;
		for(int j = 1; j < (int)pth.size()-1; j++){
			if(pth[j] != pth[j-1] && pth[j-1] != pth[j+1] && adjlst[pth[j-1]][pth[j+1]] == (adjlst[pth[j-1]][pth[j]] + adjlst[pth[j]][pth[j+1]])){
				//cout<<"not necessary to have "<<pth[j]<<" as "<<pth[j-1]<<" and "<<pth[j+1]<<" sd "<<"\n";
				pth[j] = pth[j-1];
				change = 1;
			}
		}
	}
	int prev = -1;
	vector<int>ans;
	for(int j = 0; j < pth.size();j++){
		if(pth[j] != prev){
			ans.push_back(pth[j]);
			prev = pth[j];
		}
	}
	cout<<(int)ans.size()<<"\n";
	for(auto a : ans)cout<<a+1<<" ";
	cout<<"\n";
	return 0;
}
