['#include<bits/stdc++.h>
using namespace std;

const int V = 102;
string adj[V];
int dist[V][V];

void FloydWarshall(int n){
//    cout<<"a";
    for(int i=0; i<n; i++){
//        cout<<"b";
        for(int j=0; j<n; j++){
//            cout<<"c";
            if(i == j) dist[i][j] = 0;
            else if(adj[i][j] != '0') dist[i][j] = 1;
            else dist[i][j] = 800;
        }
    }
//    cout<<"d";
    for(int i=0; i<n; i++){
//        cout<<"e";
        for(int j=0; j<n; j++){
//            cout<<"f";
            for(int k=0; k<n; k++){
//                cout<<"g";
                dist[i][j] = min(dist[i][j], dist[i][k] + dist[k][j]);
            }
        }
    }
//    cout<<"h";
    return ;
}

void print_dist(int n){
    cout<<"i"<<endl;
    for(int i=0; i<n; i++){
        for(int j=0; j<n; j++){
            cout<<dist[i][j]<<" ";
        }
        cout<<endl;
    }
}

int main(){
    int n;
    cin>>n;
//    cout<<"x";
    for(int i=0; i<n; i++){
            cin>>adj[i];
    }
//    cout<<"y";
    FloydWarshall(n);
//    print_dist(n);
//    cout<<"j";
    int m;
    cin>>m;
    int p[m];
    for(int i=0; i<m; i++){
        cin>>p[i];
    }
    vector<int> v;
    v.push_back(p[0]);
    int travel = 0, curr = p[0]-1;
    for(int i=1; i<m; i++){
        travel++;
        if(dist[curr][p[i]-1] == travel){
            if(i == m-1) v.push_back(p[i]);
            continue;
        }
        else if(dist[curr][p[i]-1] < travel){
            v.push_back(p[i-1]);
            curr = p[i-1]-1;
            travel = 1;
            if(i == m-1){
                v.push_back(p[i]);
            }
        }
    }
    cout<<v.size()<<endl;
    for(int i=0; i<v.size(); i++) cout<<v[i]<<" ";
    return 0;
}
