int main(int argc, char** argv) {
	string a;
	int ans=1;
	string b="1";
	cin >> a;
	for(int i=1;i<=1000;i++)
	{
		b="1"+b;
		if(a.size()<b.size()||a.size()==b.size()&&a<b)
		{
			cout << ans-1;
			return 0;
		}
		b=b.substr(1);
		b="0"+b;
		if(i>1) b="0"+b;
		++ans;
	}
	return 0;
}']

['#include <iostream>
using namespace std;
int main(int argc, char** argv) {
	int n,l,r;
	cin >> n >> l >> r;
	long long ans=n-l+1;
	for(int i=1;i<l;i++)
		ans+=(1<<i);
	cout << ans << " ";
	ans=0;
	int now=1;
	for(int i=1;i<=r;i++)
		ans+=now,now<<=1;
	now>>=1;
	ans+=(n-r)*now;
	cout << ans;
	return 0;
}']

['#include <iostream>
#include <vector>
using namespace std;
int e[105][105],dis[105][105];
vector <int> ans;
int qwq[1000005];
int main(int argc, char** argv) {
	int n;
	cin >> n;
	for(int i=1;i<=n;i++)
	{ 
		for(int j=1;j<=n;j++)
		{ 
			char c;
			cin >> c;
			if(c^48) e[i][j]=1;
		}
	} 
	for(int i=1;i<=n;i++)
	{
		for(int j=1;j<=n;j++)
		{
			if(e[i][j]) dis[i][j]=1;
			else dis[i][j]=1e9;
			if(i==j) dis[i][j]=0;
		}
	}
	for(int k=1;k<=n;k++)
		for(int i=1;i<=n;i++)
			for(int j=1;j<=n;j++)
				dis[i][j]=min(dis[i][j],dis[i][k]+dis[k][j]);
	int m;
	cin >> m;
	int lst=0,h=0;
	for(int i=1;i<=m;i++)
	{
		cin >> qwq[i];
		if(dis[lst][qwq[i]]!=i-h&&i-1)
		{
			lst=qwq[i-1],h=i-1;
			ans.push_back(qwq[i-1]);
		}
	}
	ans.push_back(qwq[m]);
	cout << ans.size() << "\n";
	for(auto x:ans) cout << x << " ";
	return 0;
}']

["#include<bits/stdc++.h>
#define x first
#define y second
using namespace std;
int main()
{
	string s;
	cin >> s;
	int i, c = 0;
	int t = s.size();
	for(i = 0; i < t; i++)
	{
		if(s[i] == '1')
		{
			c += (t - i - 1);
			break;
		}
	}
	int f = 1;
	for(int  j = i + 1; j < t; j++)
	{
		if(s[j] == '1')
		{
			f = 0;
			break;
		}
	}
	if(f == 0)
		cout << c / 2 + 1;
	else
		cout << c / 2;
	return 0;
}"]

